package main

import (
        "fmt"
        "encoding/hex"
)

var key = ""
var iosem = ""
var lprum = ""

func main() {

        fmt.Println("Enter sequence: ")
        fmt.Scanln(&key)

        enc1 := enc(iosem, key)
        enc2 := enc(lprum, key)

        fmt.Println("Result: ", enc1+enc2)

}

func enc(s, key string) string {
        result := ""
        d, err := hex.DecodeString(s)
        if err != nil {
                panic(err)
        }
        s = string(d)
        for i := 0; i < len(s); i++ {
                result += string(s[i] ^ key[i%25])
        }
        return result
}
